public class Solution {
    public IList<string> FindHighAccessEmployees(IList<IList<string>> access_times) {
        Dictionary<string, List<int>> accessMap = new Dictionary<string, List<int>>();
        foreach (var item in access_times) {
            if (!accessMap.ContainsKey(item[0])) accessMap[item[0]] = new List<int>();
            accessMap[item[0]].Add(int.Parse(item[1].Substring(0, 2)) * 60 + int.Parse(item[1].Substring(2, 2)));
        }

        HashSet<string> result = new HashSet<string>();
        foreach (var kvp in accessMap) {
            List<int> times = kvp.Value;
            times.Sort();
            for (int i = 0; i < times.Count - 2; i++) {
                if (times[i + 2] - times[i] < 60) {
                    result.Add(kvp.Key);
                    break;
                }
            }
        }

        return result.ToList();
    }
}
